// Todo a component that creates a sidebar menu on the left side of the screen on the file SidebarData.js
// The sidebar menu has a login and register button
// The sidebar menu has a list of links to other pages
// the sidebar is expandable and collapsable
// The sidebar menu has a search bar
// the sidebar has a toggle button to expand and collapse the sidebar

import React from 'react'
import { Link } from 'react-router-dom'
import * as FaIcons from 'react-icons/fa'
import * as AiIcons from 'react-icons/ai'
import * as IoIcons from 'react-icons/io'
import * as RiIcons from 'react-icons/ri'
import * as CgIcons from 'react-icons/cg'

export const SidebarData = [
  {
    title: 'Inicio',
    path: '/',
    icon: <AiIcons.AiFillHome />,
    cName: 'nav-text'
  },
  {
    title: 'Reportes',
    path: '/reportes',
    icon: <CgIcons.CgFileDocument />,
    cName: 'nav-text'
  },
  {
    title: 'Productos',
    path: '/productos',
    icon: <IoIcons.IoIosPaper />,
    cName: 'nav-text'
  },
  {
    title: 'Usuarios',
    path: '/usuarios',
    icon: <FaIcons.FaCartPlus />,
    cName: 'nav-text'
  },
  {
    title: 'Team',
    path: '/team',
    icon: <IoIcons.IoMdPeople />,
    cName: 'nav-text'
  },
  {
    title: 'Mensajes',
    path: '/mensajes',
    icon: <FaIcons.FaEnvelopeOpenText />,
    cName: 'nav-text'
  },
  {
    title: 'Soporte',
    path: '/soporte',
    icon: <IoIcons.IoMdHelpCircle />,
    cName: 'nav-text'
  },
  {
    title: 'Login',
    path: '/login',
    icon: <RiIcons.RiLoginBoxFill />,
    cName: 'nav-text'
  },
  {
    title: 'Register',
    path: '/register',
    icon: <RiIcons.RiLoginBoxFill />,
    cName: 'nav-text'
  },
]

